package com.coderapids.docsched.domain;public class DailySchedule {   private String scheduleDate;   private String physicianFirstName;   private String physicianLastName;   private String shiftShortname;   private String acceptedYN;   	public String getScheduleDate() {		return scheduleDate;	}		public void setScheduleDate(String scheduleDate) {		this.scheduleDate = scheduleDate;	}		public String getPhysicianFirstName() {		return physicianFirstName;	}		public void setPhysicianFirstName(String physicianFirstName) {		this.physicianFirstName = physicianFirstName;	}		public String getPhysicianLastName() {		return physicianLastName;	}		public void setPhysicianLastName(String physicianLastName) {		this.physicianLastName = physicianLastName;	}		public String getShiftShortname() {		return shiftShortname;	}		public void setShiftShortname(String shiftShortname) {		this.shiftShortname = shiftShortname;	}		public String getAcceptedYN() {		return acceptedYN;	}		public void setAcceptedYN(String acceptedYN) {		this.acceptedYN = acceptedYN;	}}